--
-- Create procedure `Proc_GetFixedAssets`
--
CREATE DEFINER = 'dev'@'%'
PROCEDURE Proc_GetFixedAssets ()
BEGIN
  SELECT
    fa.FixedAssetId,
    fa.FixedAssetCode,
    fa.FixedAssetName,
    fa.DepartmentId,
    d.DepartmentCode,
    d.DepartmentName,
    fa.FixedAssetCategoryId,
    fac.FixedAssetCategoryCode,
    fac.FixedAssetCategoryName,
    fa.PurchaseDate,
    fa.Cost,
    fa.Quantity,
    fa.DepreciationRate,
