--
-- Create procedure `Proc_GetFixedAssetPaging`
--
CREATE DEFINER = 'dev'@'%'
PROCEDURE Proc_GetFixedAssetPaging (IN $PageIndex int, IN $PageSize int, IN $IsCount bit)
BEGIN
  DECLARE $Start int;
  IF $PageSize IS NULL
    OR $PageSize <= 0 THEN
    SET $PageSize = 20;
  END IF;
  IF $PageIndex IS NULL
    OR $PageIndex <= 0 THEN
    SET $PageIndex = 1;
  END IF;
  IF $IsCount IS NOT NULL THEN
    SELECT
      COUNT(*)
    FROM FixedAsset fa;
  ELSE
    SET $Start = ($PageIndex - 1) * $PageSize;
    SELECT
      fa.FixedAssetId,
      fa.FixedAssetCode,
      fa.FixedAssetName,
      fa.DepartmentId,
      d.DepartmentCode,
      d.DepartmentName,
      fa.FixedAssetCategoryId,
      fac.FixedAssetCategoryCode,
      fac.FixedAssetCategoryName,
      fa.PurchaseDate,
      fa.Cost,
      fa.Quantity,
      fa.DepreciationRate,
      fa.TrackedYear,
      fa.LifeTime,
      fa.ProductionYear,
      fa.UseDate,
      fa.Active,
      fa.CreatedBy,
      fa.CreatedDate,
      fa.ModifiedBy,
      fa.ModifiedDate
    FROM FixedAsset fa
      INNER JOIN FixedAssetCategory fac
        ON fa.FixedAssetCategoryId = fac.FixedAssetCategoryId
      INNER JOIN Department d
        ON fa.DepartmentId = d.DepartmentId
    ORDER BY fa.CreatedDate DESC LIMIT $Start, $PageSize;
  END IF;
END
$$

--
-- Create procedure `Proc_GetFixedAssetFilter`
--
CREATE DEFINER = 'dev'@'%'
PROCEDURE Proc_GetFixedAssetFilter (IN $FixedAssetCode varchar(100), IN $FixedAssetName varchar(255), IN $DepartmentId char(36), IN $FixedAssetCategoryId char(36), IN $PageIndex int, IN $PageSize int, IN $IsCount bit)
BEGIN
  DECLARE $Start int;

  -- set default value
  IF $FixedAssetCode IS NULL THEN
    SET $FixedAssetCode = '';
  END IF;
  IF $FixedAssetName IS NULL THEN
    SET $FixedAssetName = '';
  END IF;
  IF $PageSize IS NULL
    OR $PageSize <= 0 THEN
    SET $PageSize = 20;
  END IF;
  IF $PageIndex IS NULL
    OR $PageIndex <= 0 THEN
    SET $PageIndex = 1;
  END IF;

  -- set start 
  SET $Start = ($PageIndex - 1) * $PageSize;

  -- query

  IF $IsCount IS NULL THEN
    SELECT
      fa.FixedAssetId,
      fa.FixedAssetCode,
      fa.FixedAssetName,
      fa.DepartmentId,
      d.DepartmentCode,
      d.DepartmentName,
      fa.FixedAssetCategoryId,
      fac.FixedAssetCategoryCode,
      fac.FixedAssetCategoryName,
      fa.PurchaseDate,
      fa.Cost,
      fa.Quantity,
      fa.DepreciationRate,
      fa.TrackedYear,
      fa.LifeTime,
      fa.ProductionYear,
      fa.UseDate,
      fa.Active,
      fa.CreatedBy,
      fa.CreatedDate,
      fa.ModifiedBy,
      fa.ModifiedDate
    FROM FixedAsset fa
      INNER JOIN Department d
        ON fa.DepartmentId = d.DepartmentId
      INNER JOIN FixedAssetCategory fac
        ON fa.FixedAssetCategoryId = fac.FixedAssetCategoryId
    WHERE (fa.FixedAssetCode LIKE CONCAT('%', $FixedAssetCode, '%')
    OR fa.FixedAssetName LIKE CONCAT('%', $FixedAssetName, '%'))
    AND fa.DepartmentId LIKE IF($DepartmentId IS NOT NULL, $DepartmentId, '%')
    AND fa.FixedAssetCategoryId LIKE IF($FixedAssetCategoryId IS NOT NULL, $FixedAssetCategoryId, '%')
    ORDER BY fa.CreatedDate DESC, fa.FixedAssetCode DESC LIMIT $Start, $PageSize;
  ELSE

    SELECT
      COUNT(*)
    FROM FixedAsset fa
    WHERE (fa.FixedAssetCode LIKE CONCAT('%', $FixedAssetCode, '%')
    OR fa.FixedAssetName LIKE CONCAT('%', $FixedAssetName, '%'))
    AND fa.DepartmentId LIKE IF($DepartmentId IS NOT NULL, $DepartmentId, '%')
    AND fa.FixedAssetCategoryId LIKE IF($FixedAssetCategoryId IS NOT NULL, $FixedAssetCategoryId, '%')
    ORDER BY fa.CreatedDate DESC;
  END IF;
END
$$

