--
-- Create procedure `Proc_GetFixedAssetByFixedAssetCode`
--
CREATE DEFINER = 'dev'@'%'
PROCEDURE Proc_GetFixedAssetByFixedAssetCode (IN $FixedAssetCode varchar(100), IN $FixedAssetId char(36))
BEGIN
  IF $FixedAssetId IS NULL THEN
    SELECT
      *
    FROM FixedAsset fa
    WHERE fa.FixedAssetCode = $FixedAssetCode;
  ELSE
    SELECT
      *
    FROM FixedAsset fa
    WHERE fa.FixedAssetCode = $FixedAssetCode
    AND fa.FixedAssetId <> $FixedAssetId;
  END IF;
END
$$

